Lifetime parameters give a unique opportunity to link together different parts of an API in the mind of a user. If the same data is used in multiple places in an API, make sure the lifetime names match. Lifetime names should be derived from the reference they represent, not from the type they are passed to. Further, they should consist of either a single letter, short word or extremely well understood acronym. Numbers should not be used in lifetime names. Single-letter lifetime names are acceptable if a structure is expected to be used very many times (e.g. a script interface may make heavy use of some Value<'h> which contains a reference to a heap upon which it is allocated). NB: the compiler will occasionally recommend the use 'a as it lacks wider context information. The name 'a is nearly always a bad one. Lifetime parameters should aim to be concise without losing meaning. Given the difficulty new users face when understanding lifetimes in an interface, try to give them a hand by being explicit. Single-letter lifetime names should generally be avoided. ✅ Do this: struct ASTQueryMatch<'cursor, 'tree> { /* ... */
# ignore: &'cursor &'tree (),
} struct Value<'h> { /* ... */
# ignore: &'h (),
} ⚠️ Avoid this: struct ASTQueryMatch<'a, 'b> { /* ... */
# ignore: &'a &'b (),
} struct Value<'value> { /* ... */
# ignore: &'value (),
}

