Structs, like tuples, provide an excellent way to group together related information of different types. Unlike tuples however, they force values to be named, thus avoiding any forgettable-ordering problems. When each field is given a value, there are three possible forms to choose from: The field has its value moved in from a variable with the same name, The field has its value moved in from a variable with a different name, The field takes its value from the result of some computation. The first form is the cleanest for struct population as not only does it use the least characters, it also implies that the concepts being handled are very compatible and that there is a clear flow of data present. This makes the code easier to read, hence wherever reasonable, we should aim for this form. The second form is acceptable if the name of the field and the name of the value are similar, for example one name being a sub-string of the other. If it is not possible to tune naming to make this true, then this is a sign of messy concepts at play and hence that a refactor is needed. The third form can be the most problematic as large computations often draw too much attention, effectively hiding both smaller computations and the other two field-forms above. Drawing attention in this way indicates that the code awkwardly interleaves separate actions—the same section of code is both populating a struct and doing detailed computation to determine its contents. To avoid some fields sticking out like a sore thumb, either all fields of a struct should be computed or none should be. In case of a mix, refactor computations into a new let declarations, matching the order of the fields as closely as possible and use the first form above. This avoids the reader having to wade through alphabet soup. The order in which fields are populated must be the same as the type declaration. Each line which populates a field in a given struct must be independent. If there is a dependency between field 